import "./topbar.scss";
import { useState } from 'react';
import React from "react";
//import {Person} from "@material-ui";



class Topbar extends React.Component {
  constructor() {
    super();

    this.state = {
      sandwich: false,
    };
  }

  handleClick = () => {
    if (this.sandwich == 'false') {
      this.setState({
        sandwich: true
      })
    } else {
      this.setState({
        sandwich: false
      })
    }
  };

  render() {
    let temp = "topbar"
    if (this.sandwich) {
      temp += " active"
    }
    return (
      <div className={temp}>
      <div className="wrapper">
        <p className="gauche">
          <a href="#" className="logo">
            Anthony Bauchet
          </a>
          <div className="itemContainer">
          <p>dlso.mesgrossescouilles.fr</p>
        </div>
        <div className="itemContainer">
          <p>06 6666666666</p>
        </div>
        </p>
        

        <p className="droite">
          <div className="sandwich">
            <button onclick={this.state.sandwich}>
            <span className="line1"></span>
            <span className="line2"></span>
            <span className="line3"></span>
            </button>
          </div>
        </p>
      </div>
    </div>
    );
  }
}

export default Topbar;

